<script>
import { gsap } from "gsap";

export default {
    name: "Dojang",
    components: {},
    data() {
        return {
            dojangPlacedElements: false,
            carouselCurrentIndex: undefined
        }
    },
    methods: {
        dojangInitAnimations() {

            this.dojangPlacedElements = false;
            let animDuration = 0.6;

            gsap.from("#dojang_bob", {
                y: -1000,
                duration: 1,
                delay: 1.3,
                ease: "bounce.out",
            });
            gsap.from("#dojang_bob", {
                rotation: 5,
                transformOrigin: "50% 100%",
                duration: 1.3,
                delay: 1.8,
                ease: "elastic.out(1,0.3)"
            });

            gsap.from("#dojang_bottle", {
                x: -900,
                duration: animDuration,
                delay: 0.78,
                ease: "power1.out",
            });
            gsap.to("#dojang_bottle", {
                duration: 0.3,
                yoyo: true,
                transformOrigin: "100% 100%",
                repeat: 1,
                delay: 1.2,
                rotation: 25,
                ease: "slow (0.7, 0.7, false"
            });

            gsap.from("#dojang_exterior", {
                x: 550,
                duration: animDuration,
                delay: 0.25,
            });
            gsap.from("#dojang_local", {
                x: 600,
                duration: animDuration,
                delay: 0.25,
            });
            gsap.from("#dojang_table", {
                x: -900,
                duration: animDuration,
                delay: 0.7,
                ease: "power1.out",
            });
            gsap.from("#dojang_tatamis", {
                x: -700,
                duration: animDuration,
                delay: 0.25,
            });
            gsap.from("#dojang_wall, #dojang_pictures, #dojang_breastplate", {
                x: 700,
                duration: animDuration,
                delay: 0.25,
            });

            gsap.from(".dojang_picture_item", {
                duration: 0.5,
                delay: 1.3,
                scale: 0,
                ease: "bounce.out",
                xPercent: "50",
                stagger: 0.05
            });

            gsap.to(".dojang_scene", {
                duration: 0.08,
                yoyo: true,
                repeat: 3,
                delay: 1.65,
                y:5
            });

            let breastplateTimeline = gsap.timeline();

            breastplateTimeline.to("#dojang_breastplate",{
                transformOrigin: "50% 0%",
                rotate: -8,
                duration: 0.6,
                delay: 0.30,
            });
            breastplateTimeline.to("#dojang_breastplate",{
                transformOrigin: "50% 0%",
                rotate: 6,
                duration: 0.3,
            });
            breastplateTimeline.to("#dojang_breastplate",{
                transformOrigin: "50% 0%",
                rotate: 0,
                duration: 1,
                ease: "elastic.out(1,0.3)"
            });

            gsap.from("#dojang_curtain", {
                opacity: 0,
                delay: 2.2,
                duration: 0.5
            });

            gsap.from("#dojang_banner", {
                opacity: 0,
                delay: 2.2,
                duration: 1,
                x: -50
            })

            setTimeout(() => {
                this.dojangPlacedElements = true
            }, 2800);
        },

        dojangParallax(event) {
            if (this.dojangPlacedElements == true) {                
                let posX = (event.pageX * 2 / document.body.clientWidth) - 1 ;
                let posY = (event.pageY * 2 / document.body.clientWidth) - 1 ;
    
                gsap.to("#dojang_bob, #dojang_tatamis, #dojang_floor", {
                    x: posX * -35,
                });
    
                gsap.to("#dojang_wall, #dojang_pictures, #dojang_breastplate, #dojang_table, #dojang_bottle", {
                    x: posX * -30
                })
    
                gsap.to("#dojang_local", {
                    x: posX * -24
                })
    
                gsap.to("#dojang_exterior", {
                    x: posX * -20
                })
    
                gsap.to(".dojang_scene", {
                    y: posY * -30
                })
            }
        },

        nextSlide() {
            let index = this.carouselCurrentIndex;
            index >= 3 ? index = 1 : index++;

            this.switchSlide(index);
        },

        showSlide(index) {
            let slides = document.querySelectorAll(".dojang_carousel_slide");
            slides[index - 1].classList.add("slide_active");
            slides[index - 1].style.display = "block";

            let pins = document.querySelectorAll(".dojang_carousel_pin");
            pins[index - 1].classList.add("pin_active");

            gsap.fromTo(".slide_active", 
                {
                    x: -50,
                    opacity: 0,
                },
                {
                    x: 0,
                    opacity: 1,
                    duration: 0.5
                }
            );

            this.carouselCurrentIndex = index;
        },

        switchSlide(index) {
            if (index != this.carouselCurrentIndex) {                
                gsap.to(".slide_active", {
                    x: 50,
                    opacity: 0,
                    duration: 0.5
                });
    
                document.querySelector(".pin_active").classList.remove("pin_active");
    
                setTimeout(() => {
                    document.querySelector(".slide_active").style.display = "none";
                    document.querySelector(".slide_active").classList.remove("slide_active");
    
                    this.showSlide(index);                 
                }, 500);
            }
        },
    },
    mounted() {
        setTimeout(() => {
            this.showSlide(1);

            setTimeout(() => {
                document.getElementById("dojang_carousel_timeline").style.display = "flex";
                gsap.from("#dojang_carousel_timeline", {x: -50, opacity: 0, duration: 0.5});                
            }, 200);
           
        }, 2500);

        setInterval(() => {
            setTimeout(() => {
                this.nextSlide();
            }, 1000);
        }, 10000);
    }
}
</script>

